pragma solidity ^0.8.0;
import "./Helpers.sol";

contract Library is Helpers{
    address public owner;

    struct Book {
        uint id;
        string name;
        uint quantity;
        bool exists;
    }

    uint counter;

    mapping(string => Book) BookList;

    mapping(string => address[]) BookBorrowerList;

    mapping(address => string[]) ClientBorrowList;

    modifier onlyOwnable(){
        require(msg.sender == owner, "Current user is not owner!");
        _;
    }

    constructor(){
        owner = msg.sender;
    }

    function AddBook(Book calldata book) public onlyOwnable{
        string memory bookName = book.name;

        if(BookList[bookName].exists){
            revert("Book already exists in the Library!");
        }

        BookList[bookName].id = counter;
        BookList[bookName].name = book.name;
        BookList[bookName].quantity = book.quantity;
        BookList[bookName].exists = true;
        counter++;
