pragma solidity ^0.8.0;

contract Helpers{
    uint[] public firstArray = [1,2,3,4,5];

    function removeItem(uint i) public{
      delete firstArray[i];
    }

    function getLength() public view returns(uint){
      return firstArray.length;
    }

    //move to helper contract
